import axios from 'axios';

const Home = () => {
    const [state,setDtate] = useState([]);
    useEffect (()=>{
        axios.get ('http://localhost:9000/get-data')
        .then(res =>{
            console.log(res);
            setDate(res.data)
        })
    },[])
  return (

    <ul>
    {state.map((item) => {
      <li>{item.name}</li>
    })}
    </ul>
  )

}

export default Home;
